import { useState } from 'react';
import './register.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useNavigate } from 'react-router-dom';
import Header from './Header';

function Register() {
    const [activeTab, setActiveTab] = useState('event-organizer');

    const validateForm = (event) => {
        event.preventDefault();
        const form = event.target;
        const email = form.email.value;
        const confirmEmail = form["confirmEmail"].value;
        const password = form.password.value;
        const confirmPassword = form["confirmPassword"].value;
        if (email !== confirmEmail) {
            alert("Emails do not match!");
            return false;
        }
        if (password !== confirmPassword) {
            alert("Passwords do not match!");
            return false;
        }
        alert("Form submitted successfully!");
        return true;
    };

    const renderForm = (userType) => (
        <form onSubmit={validateForm}>
            <input type="text" placeholder="First Name" name="fname" required />
            <input type="text" placeholder="Last Name" name="lname" required />
            {userType !== 'attendee' && <input type="text" placeholder="Company Name" name="company" />}
            <input type="email" placeholder="Email Address" name="email" required />
            <input type="email" placeholder="Confirm Email Address" name="confirmEmail" required />
            <input type="password" placeholder="Password" name="password" required />
            <input type="password" placeholder="Confirm Password" name="confirmPassword" required />
            <input type="file" required />
            <button type="submit">Submit</button>
        </form>
    );

    return (
        <div className="container">
            <div className="tab-group">
                <div className={`tab ${activeTab === 'event-organizer' ? 'active' : ''}`} onClick={() => setActiveTab('event-organizer')}>Event Organizer</div>
                <div className={`tab ${activeTab === 'artist' ? 'active' : ''}`} onClick={() => setActiveTab('artist')}>Artist</div>
                <div className={`tab ${activeTab === 'attendee' ? 'active' : ''}`} onClick={() => setActiveTab('attendee')}>Attendee</div>
            </div>

            <div id="event-organizer" className={`form-section ${activeTab === 'event-organizer' ? 'active' : ''}`}>
                <h2>Create Event Organizer Account</h2>
                {renderForm('event-organizer')}
            </div>
            <div id="artist" className={`form-section ${activeTab === 'artist' ? 'active' : ''}`}>
                <h2>Create Artist Account</h2>
                {renderForm('artist')}
            </div>
            <div id="attendee" className={`form-section ${activeTab === 'attendee' ? 'active' : ''}`}>
                <h2>Create Attendee Account</h2>
                {renderForm('attendee')}
            </div>
        </div>
    );
}

export default Register;
